    false,nt"url": null,nt"notes": "This annual narrative report for Browns
    Park National Wildlife Refuge outlines Refuge accomplishments during the 1969 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    and water conditions during the year. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, mammals, raptors, fish, reptiles,
    and diseases- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and vegetation control. Resource management is
    outlined; topics include grazing and haying. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, hunting, violations,
    and safety. Items of interest and photographs are attached.",nt"owner_org":
